import React, { useState, useEffect } from 'react';

const CATEGORIES = [
  { value: 'Park', label: 'Parks', defaultChecked: true },
  { value: 'Market', label: 'Markets', defaultChecked: true },
  { value: 'Restaurant', label: 'Restaurants', defaultChecked: true },
  { value: 'Café', label: 'Cafés', defaultChecked: false },
  { value: 'Attraction', label: 'Attractions', defaultChecked: false },
  { value: 'Mall', label: 'Malls', defaultChecked: false },
];

const VIBES = [
  { value: 'authentic', label: 'Authentic', defaultChecked: true },
  { value: 'local', label: 'Local', defaultChecked: true },
  { value: 'chill', label: 'Chill', defaultChecked: true },
  { value: 'adventurous', label: 'Adventurous', defaultChecked: false },
  { value: 'scenic', label: 'Scenic', defaultChecked: false },
];

function TripForm({ onSubmit, disabled, neighbourhoods }) {
  const [startLocation, setStartLocation] = useState('CBD');
  const [budget, setBudget] = useState(2000);
  const [hours, setHours] = useState(8);
  const [categories, setCategories] = useState(
    CATEGORIES.filter(c => c.defaultChecked).map(c => c.value)
  );
  const [vibes, setVibes] = useState(
    VIBES.filter(v => v.defaultChecked).map(v => v.value)
  );
  const [freeText, setFreeText] = useState('');

  useEffect(() => {
    if (neighbourhoods.length > 0 && !neighbourhoods.includes(startLocation)) {
      setStartLocation(neighbourhoods[0]);
    }
  }, [neighbourhoods, startLocation]);

  const handleCategoryChange = (value) => {
    setCategories(prev => 
      prev.includes(value) 
        ? prev.filter(c => c !== value)
        : [...prev, value]
    );
  };

  const handleVibeChange = (value) => {
    setVibes(prev => 
      prev.includes(value) 
        ? prev.filter(v => v !== value)
        : [...prev, value]
    );
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSubmit({
      startLocation,
      budget: Number(budget),
      hours: Number(hours),
      categories,
      vibes,
      freeText
    });
  };

  return (
    <form onSubmit={handleSubmit}>
      <div className="field-group">
        <label htmlFor="start-location">Starting neighbourhood</label>
        <select 
          id="start-location" 
          value={startLocation}
          onChange={(e) => setStartLocation(e.target.value)}
          required
          disabled={disabled || neighbourhoods.length === 0}
        >
          {neighbourhoods.map(n => (
            <option key={n} value={n}>{n}</option>
          ))}
        </select>
      </div>

      <div className="field-row">
        <div className="field-group">
          <label htmlFor="budget">Total budget (KSH)</label>
          <input
            id="budget"
            type="number"
            min="100"
            step="50"
            value={budget}
            onChange={(e) => setBudget(e.target.value)}
            required
            disabled={disabled}
          />
        </div>
        <div className="field-group">
          <label htmlFor="hours">Available time (hours)</label>
          <input
            id="hours"
            type="number"
            min="1"
            max="16"
            step="0.5"
            value={hours}
            onChange={(e) => setHours(e.target.value)}
            required
            disabled={disabled}
          />
        </div>
      </div>

      <fieldset className="field-group">
        <legend>Preferred categories</legend>
        <div className="pill-row">
          {CATEGORIES.map(cat => (
            <label key={cat.value} className="pill">
              <input
                type="checkbox"
                value={cat.value}
                checked={categories.includes(cat.value)}
                onChange={() => handleCategoryChange(cat.value)}
                disabled={disabled}
              />
              <span>{cat.label}</span>
            </label>
          ))}
        </div>
      </fieldset>

      <fieldset className="field-group">
        <legend>Preferred vibes</legend>
        <div className="pill-row">
          {VIBES.map(vibe => (
            <label key={vibe.value} className="pill">
              <input
                type="checkbox"
                value={vibe.value}
                checked={vibes.includes(vibe.value)}
                onChange={() => handleVibeChange(vibe.value)}
                disabled={disabled}
              />
              <span>{vibe.label}</span>
            </label>
          ))}
        </div>
      </fieldset>

      <div className="field-group">
        <label htmlFor="free-text">Optional: describe what you want</label>
        <input
          id="free-text"
          type="text"
          value={freeText}
          onChange={(e) => setFreeText(e.target.value)}
          placeholder="e.g. peaceful, nature, not too crowded"
          disabled={disabled}
        />
        <p className="hint">
          Free-text is matched against place tags (simple semantic approximation for this demo).
        </p>
      </div>

      <button type="submit" className="primary-btn" disabled={disabled}>
        Generate itinerary
      </button>
    </form>
  );
}

export default TripForm;
